import React, {useState, useRef, useEffect} from "react";

import '../../../styles/shared/analytics/analytics_list_item.css';

const AnalyticsListItem = ({ data, index }) => {

    /**
     * @function
     */
    const detailedView = () => {
        alert('open detailed view')
    }

    console.log(data.review)
    console.log(data.coderCoverage)
    console.log(data.studentCoverage)

    return (
        <div className="analytics_list_item_wrapper" onClick={() => detailedView()}>



        </div>
    );
};

export default AnalyticsListItem;
